import React, { Component } from 'react'
import Link from 'next/link'

class Navbar extends Component {
    constructor(props) {
        super(props);
        
    }
    
    render() {
        return (
            <nav>
                <Link href='/'>
                    <a title="Our API">
                        Home
                    </a>
                </Link>
                <Link href="/about">
                    <a title="About NextJS">About NexxtJS</a>
                </Link>
                <style jsx>
                    {`
                        nav {
                            background : green
                        }
                        nav a {
                            padding : 10px 20px;
                            text-decoration : none;
                            color : black;
                        }
                    `}
                </style>
            </nav>
        )
    }
}
export default Navbar
